syntax = "proto3";

package zproto;

import "stru_dirty_mask.proto";

message GashaGuaranteeInfo {
    uint32 id = 1;
    uint32 guaranteeX = 2;
    uint32 guaranteeY = 3;
    int32 residueGuaranteeTimeX = 4;
    int32 residueGuaranteeTimeY = 5;
    int32 residueGuaranteeTimeZ = 6;
    uint32 guaranteeZ = 7;
